import Main from "../main";
import Menu from "../menu";
const RouterPage = () => {
  return (
    <>
      <Route>
        <Main />
      </Route>
      <Route exact path="/menu">
        <Menu />
      </Route>
    </>
  );
};

export default RouterPage;
